153	default	Un nouveau Article a √©t√© cr√©√©	created	App\\Models\\Article	3	\N	\N	{"attributes":{"title":{"fr":"Sodomie","en-US":"Anal Sex","es":"Sexo Anal","de":"Analverkehr","it":"Sesso Anale"},"slug":"sodomie","excerpt":{"fr":"La sodomie fait r\\u00e9f\\u00e9rence \\u00e0 une pratique sexuelle dans laquelle un individu p\\u00e9n\\u00e8tre l\\u2019anus de son partenaire avec un doigt ou une autre partie du corps, un objet ou le p\\u00e9nis. C\\u2019est une forme de stimulation anale qui peut \\u00eatre pratiqu\\u00e9e aussi bien par des partenaires de m\\u00eame sexe que de sexes diff\\u00e9rents.","en-US":"Sodomy refers to a sexual practice in which an individual penetrates their partner\\u2019s anus with a finger, another body part, an object, or the penis. It is a form of anal stimulation that can be practiced by partners of the same or different sexes.","es":"La sodom\\u00eda se refiere a una pr\\u00e1ctica sexual en la que una persona penetra el ano de su pareja con un dedo, otra parte del cuerpo, un objeto o el pene. Es una forma de estimulaci\\u00f3n anal que puede practicarse entre personas del mismo o de diferente sexo.","de":"Sodomie bezeichnet eine sexuelle Praktik, bei der eine Person den Anus ihres Partners mit einem Finger, einem anderen K\\u00f6rperteil, einem Gegenstand oder dem Penis penetriert. Es handelt sich um eine Form der analen Stimulation, die sowohl von gleichgeschlechtlichen als auch von verschiedengeschlechtlichen Partnern praktiziert werden kann.","it":"La sodomia si riferisce a una pratica sessuale in cui una persona penetra l\\u2019ano del partner con un dito, un\\u2019altra parte del corpo, un oggetto o il pene. \\u00c8 una forma di stimolazione anale che pu\\u00f2 essere praticata sia da partner dello stesso sesso sia di sesso diverso."},"content":{"fr":"<p>La sodomie fait r\\u00e9f\\u00e9rence \\u00e0 une pratique sexuelle dans laquelle un individu p\\u00e9n\\u00e8tre l\\u2019anus de son partenaire avec un doigt ou une autre part